    `Segmento` text,
    `Modelo do Avião` text,
    `Quantidade entregue` bigint DEFAULT NULL,
    `Ano de fabricação` bigint DEFAULT NULL,
    `Ano de entrega` bigint DEFAULT NULL,
    `Quantidade de Motores` bigint DEFAULT NULL,
    `Tamanho do tanque (litros)` bigint DEFAULT NULL,
    `Peso do avião vazio` double DEFAULT NULL,
    `Custo de combustível - AVGAS (pré pandemia)` text,
    `Custo de combustível AVGAS (pós pandemia)` text,
    `Custo de combustível - querosene` text,
    `Custo de combustível - querosene (póspandemia)` text,
    `Quantidade encomendada` bigint DEFAULT NULL,
    `Pedidos Firmes em Carteira` bigint DEFAULT NULL,
    `Cliente` text,
    `Origem` text,
    `Destino` varchar(255) DEFAULT NULL,
    `Distância (km)` bigint DEFAULT NULL,
    `Autonomia (km)` bigint DEFAULT NULL,
    `Parada para reabastecer` bigint DEFAULT NULL,
    `Frete (pre pandemia - AVGAS)` text,
    `Frete (pos pandemia - AVGAS)` text,
    `Frete - QAV` text,
    `Frete (pos pandemia - QAV)` text,
    `Custo total AVGAs` text,
    `Custo total QAV` text,
    `Custo de Transporte (entregas futuras - AVGAS)` text,
    `Custo de Transporte (entregas futuras - QAV)` text,
    PRIMARY KEY (`id_comercial`),
    KEY `fk_destino_destino` (`Destino`),
    CONSTRAINT `fk_destino_destino` FOREIGN KEY (`Destino`) REFERENCES `bd_aumentado_comercial` (`Destino`)
    ) ENGINE=InnoDB AUTO_INCREMENT=130 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
